import React, { useState } from 'react';
import Button from "../../components/Button/Button Login";

const Droppdown = () => {
  const [isOpen, setIsOpen] = useState(false);

  const toggleDropdown = () => {
    setIsOpen(!isOpen);
  };

  return (
    <div className="droppdown">
       <Button Text="Entrar" onClick={toggleDropdown} />

      {isOpen && (
        <div className="droppdown-content">
          <p>Usuário</p>
          <p>Permissões</p>
          <p>Classes</p>
          <p>Composição</p>
          <p>Categoria</p>
          <p>Elástico</p>
          <p>Marca Elástico</p>
          <p>Tipo Elástico</p>
          <p>Agulha</p>
          <p>Máquina Agulha</p>
          <p>Espécie de Agulha</p>
          <p>Marca Agula</p>
          <p>Embalagem</p>
          <p>Unidade</p>
          <p>Linha</p>
          <p>Tecido</p>
    
        
        </div>
      )}
    </div>
  );
};

export default Droppdown;
